import React, {useState} from 'react';
import '../css/reporttable.css';
import { createAPIEndpoint, ENDPOINTS } from '../api/index.js';

function StatsMonthly() {
    const [data, setData]= useState([]);

    const blankFilters = {
        year: new Date().getFullYear(),
        month: ""
    };

    const [filters, setFilters] = useState(blankFilters);
    const updateFilters = (obj) => {setFilters({...filters,...obj});}

    const getreport = () => {
        createAPIEndpoint(ENDPOINTS.report+filters.month+'/'+filters.year)
        .get()
        .then(response => {
            console.log(response.data);
            setData(response.data)})
        .catch(error => console.log(error))
    }

    const renderTable = () => {
        let info = data;
        return info.map(elem => {
            return (
                <tr>
                    <td></td>
                </tr>
            );}
        )
    }

    let todaysYear = new Date().getFullYear();
    return (
        <div className='searchbox'>
            <h2>Monthly Reports</h2>
            <div>
                <p>*Search by year and month.</p>
                <form name="ridesearch" id="ridesearch">
                    <table className="filter-table">
                        <tr>
                            <th>Year:</th>
                            <th>Month:</th>
                        </tr>
                        <tr>
                            <td><input type="number" name="year" onChange={(e) => updateFilters({year:e.target.value})} min="2022" max={todaysYear} required/></td>
                            <td><select type="text" name="month" onChange={(e) => updateFilters({month:e.target.value})} required>
                                    <option defaultValue>Select a Month</option>
                                    <option value="January">January</option>
                                    <option value="February">February</option>
                                    <option value="March">March</option>
                                    <option value="April">April</option>
                                    <option value="May">May</option>
                                    <option value="June">June</option>
                                    <option value="July">July</option>
                                    <option value="August">August</option>
                                    <option value="September">September</option>
                                    <option value="October">October</option>
                                    <option value="November">November</option>
                                    <option value="December">December</option>
                                </select>
                            </td>
                        </tr>
                    </table>
                </form>
            </div><br/>
            <button onClick={getreport} className="submit-button" type="button">Search Month</button>
            <br /><br />
            <br /><br />
            <table className="result-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Description</th>
                        <th>Location</th>
                        <th>Minimum Height</th>
                        <th>Start Time</th>
                        <th>End Time</th>
                        <th>Breakdowns</th>
                    </tr>
                </thead>
                <tbody>{renderTable()}</tbody>
            </table>
        </div>

    )
}

export default StatsMonthly;
